  const fret = chord;

  doNote(chord);
  return dotableTab(str, fret);
}

function doNote() {}

function dotableTab(string, fret) {
  console.log(string);
  return (
    <>
      <table>
        <tr className={css.fret}>
          <td>{string === 1 && 'X'}</td>
          <td>0</td>
          <td>0</td>
          <td>0</td>
          <td>0</td>
